import React from "react";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import ProfileImage from "./assets/images/portrait.png";

const Profile = () => {
  return (
    <div className="profile-section flex-1 flex items-center justify-center p-8">
      <div className="flex flex-row w-full max-w-3xl bg-gray-800 rounded-lg shadow-lg overflow-hidden">
        {/* Left Box: Profile Image */}
        <div className="flex items-center justify-center w-1/2 bg-gray-900 p-8">
          <img
            src={ProfileImage}
            alt="Profile"
            className="w-40 h-40 rounded-full border-4 border-gray-700 object-cover"
          />
        </div>
        {/* Right Box: Description */}
        <div className="flex flex-col justify-center w-1/2 p-8 text-white">
          <h1 className="text-4xl font-bold mb-2">John Doe</h1>
          <p className="text-xl">Software Developer</p>
        </div>
      </div>
    </div>
  );
};

export default Profile;
